import React from 'react'
import TodoList from './components/TodoList'
function TodoFeature(props) {
    const todoList = [
        {
            id: 1,
            title: 'do something1'
        },
        {
            id: 2,
            title: 'do something2'
        },
        {
            id: 3,
            title: 'do something3'
        },
        {
            id: 4,
            title: 'do something4'
        },
        {
            id: 5,
            title: 'do something5'
        },
        {
            id: 6,
            title: 'do something6'
        },
    ]

  return (
    <div>
        <h3>Todo List</h3>
        <TodoList todoList={todoList}/>
    </div>
  )
}


export default TodoFeature
